import React from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";
import Paper1 from "../components/Paper1";

function Leistung1() {
  return (
    <div>
      <Header />
      <div className="row">
        <div className="col-8">
          <Paper1 />
        </div>
        <div className="col-4">
          <Paper1 />
        </div>
      </div>
      <Paper1 />
      <Footer />
    </div>
  );
}

export default Leistung1;
